import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial_page.png'));

    // 1. Locate the search input field and type 'iPhone'
    const searchInput = page.locator('#searchInput');
    await searchInput.waitFor({ state: 'visible' });
    await searchInput.fill('iPhone');

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_text_entered.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_text_entered.png'));

    // 2. Locate and click the search button
    const searchButton = page.locator('button.search-btn').first();
    await searchButton.waitFor({ state: 'visible' });
    await searchButton.click();

    // 3. Wait for the search results to be displayed (simulated by JS)
    // The script.js will generate a header like "Search Results for 'iPhone'"
    const resultsHeaderLocator = page.locator('h2:has-text("Search Results for \\"iPhone\\"")');
    await resultsHeaderLocator.waitFor({ state: 'visible', timeout: 5000 });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // 4. Extract data to verify the task
    const resultsHeaderText = await resultsHeaderLocator.textContent();
    const resultsCountText = await page.locator('.results-count').textContent();
    const productCount = await page.locator('.products-grid .product-card').count();

    const extractedData = {
      searchQuery: 'iPhone',
      resultsHeaderText: resultsHeaderText.trim(),
      resultsCountText: resultsCountText.trim(),
      displayedProductCount: productCount,
    };

    return {
      success: true,
      action: "Searched for 'iPhone' and verified the results page.",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    // On failure, take a final screenshot if possible
    try {
      const errorPath = path.join(screenshotsDir, 'error_screenshot.png');
      await page.screenshot({ path: errorPath });
      screenshots.push(errorPath);
    } catch (e) {
      // Ignore if screenshot fails
    }

    return {
      success: false,
      action: "Failed to search for 'iPhone' products.",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
